    res.company_id,
    res.facility_buyer_id,
    res.facility_cultivator_id,
    res.surveys,
    ( SELECT survey.appealing_visually
           FROM (public.survey survey
             LEFT JOIN public.subcompany s ON ((s.id = survey.subcompany_id)))
          WHERE ((survey.deleted_date IS NULL) AND (survey.status = ANY (ARRAY['SurveySent'::public.survey_status_enum, 'Done'::public.survey_status_enum])) AND (s.company_id = res.company_id))
          GROUP BY survey.appealing_visually
          ORDER BY (count(*)) DESC
         LIMIT 1) AS appealing_visually,
    ( SELECT survey.color
           FROM (public.survey survey
             LEFT JOIN public.subcompany s ON ((s.id = survey.subcompany_id)))
          WHERE ((survey.deleted_date IS NULL) AND (survey.status = ANY (ARRAY['SurveySent'::public.survey_status_enum, 'Done'::public.survey_status_enum])) AND (s.company_id = res.company_id))
          GROUP BY survey.color
          ORDER BY (count(*)) DESC
         LIMIT 1) AS color,
